import {Line} from 'react-chartjs-2'

const Chart = ({buildingName, amount, dates, listaDeptos}) => {
    return (
        <div className="h-80">
            <h2 className="text-3xl text-center font-bold">Chart</h2>
            <div className="flex flex-row justify-center justify-around">
            <canvas id="myChart" width="400" height="400"></canvas>
            <Line
            datasetIdKey='id'
            data={{
                labels: ['Jun', 'Jul', 'Aug'],
                datasets: [
                {
                    id: 1,
                    label: 'Income',
                    data: [5, 6, 7],
                },
                {
                    id: 2,
                    label: '',
                    data: [3, 2, 1],
                },
                ],
            }}
            />

            
            </div>
        </div>
    )
}

export default Chart
